"""### C

c) Plot **portfolio possibility curve** of selected 6 stocks.

**Porfolio possibility set**
* Assume that we want to **present trade off between risk and reward for all possible portfolios** (all possible vectors of weights that you can think of) of this 6 stocks graphically (i.e. **porfolio possibility set**). **Position** of each portfolio on the graph is **determined by it's risk and reward**:
    * X axis $\to$ Risk (volatility)
    * Y axis $\to$ Reward (expected returns)

![s1.png](data:image/png;base64,)

* Let us take a look at the picture below. In which portfolios would **rational person invest** if he/she wants to have expected return of 0.6?

![s1.png](data:image/png;base64,)

**Porfolio possibility curve**
* PPC - **edge line of porfolio possibility set** (which is plane), i.e. edge of set of all possible portfolios
* It is obtained in process of **mean-variance optimization**
    * Portfolios which appear on this curve has **minimal level of risk for the given level of reward** (this is how we can find them)

**Why do we care about it?**
* If we want to **invest optimally** we will **pick some portfolio from this curve** based on our **risk-reward preferences**
* **Any other portfolio** (which isn't on this curve) will bring us **higher level of risk** than corresponding portfolio from this curve.

![s2.png](data:image/png;base64,)

**Back to computation**
* Import my small module <font color='DarkTurquoise'><b>qt</b></font>

**Computation**
* To plot it we use <font color='Blue'><b>inv.EF</b></font> function (short from Efficient frontier):
    * By **default** function returns **corrdinates of points on PPC**
    * If you **want to plot** them, you can use optional parameter ***plot***
"""

EF = qt.EF(ret,plot='full')
EF

"""### D

d) Plot **Efficient frontier** of selected 6 stocks. Set the range of considered expected returns to 1% - 150%.

* **Not all** portfolios from prvious curve are really **efficient** (see the graph)
* EF - **efficient part of PPC**
    * Porfolios below MVP has subsitutes in upper part of the curve which **offer higher reward for the same level of risk**
"""

fig1=qt.EF(ret,Range=[0.01,1.5],plot='full')
fig1

"""### E

e) **Download** data about **risk-free rate** in U.S.A. **from FRED** for **entire 2022**. Consider U.S. **10-Year Treasuries with constant maturity** (ticker DGS10) as risk-free instrument.
"""

import pandas_datareader as pdr

rfa = pdr.get_data_fred('DTB3',start='2022-08-01',end='2023-08-01')/100

rfa.head()

rfa.dropna()

"""**Deannualization (EAR)**
* You **have downloaded annualized** risk-free rates
    * To **convert** them back **into daily** level we use:

$$(1+rf_d)^{252}-1=rf_a$$

$$(1+rf_d)^{252}=(1+rf_a)$$

$$rf_d=\sqrt[252]{1+rf_a}-1$$
"""

rf=(1+rfa)**(1/252)-1
rf.head()
rf.dropna()

"""### F

f) Find portfolio (in terms of weights) which **maximizes Sharpe ratio** of your investment.

* With this we search for the **best possible trade off between risk and reward**

$$(max) \frac{W\cdot E - r_r}{\sqrt{W\cdot \Sigma \cdot W}}$$<br>
$$\text{s.t.} \hspace{5mm} W\cdot l=1$$

**Computation**
* To find such portfolio we use <font color='Blue'><b>maxSharpe</b></font> function
"""

opt = qt.maxSharpe(ret,rf)
opt

"""### G

g) **Present** previously obtained **porfolio graphically**. Use the same graph (i.e. figure) that you have created previously. What do you **conclude about efficiency** of this porfolio.

* Import <font color='MediumSeaGreen'><b>Plotly - Graph Objects</b></font>
"""

import plotly.graph_objects as go

"""**Idea**
* Add new trace on prviously created figure:
  * X $\to$ risk <font color='Blue'><b>pV</b></font>
  * Y $\to$ reward <font color='Blue'><b>per</b></font>
"""

fig1.add_trace(go.Scatter(x=[qt.pV(opt['w'],ret,vol=True)],
                          y=[qt.per(opt['w'],ret)],
                           marker = dict(color='Crimson', size=10,line=dict(color='Black',width=2))))

fig1.show()

"""### H

h) Assume that you have invested **2 000 000 dollars** in portfolio estimated in part f). Show **historical evolution** of your investment (i.e. wealth) assuming that you have **bought quantity of stocks recommended by portfolio weights** on 01-01-2021 and **holding this quantity of stock for exactly one year**. Present evolution **graphically**.

**Step 1**
- Determine **intial wealth** (investment)
"""

Wealth = 2000000

"""**Step 2**
- Determine **amount of money** which should be **invested in each stock**
"""

si=opt['w']*Wealth

"""**Step 3**
- Determine **number of stock** which you can buy
$$n=\frac{\text{amount that you wat to invest}}{P_0}$$
"""

n=si/prices.iloc[0]
n

"""**Step 4**
- Compute **value of your portfolio** at each point in time
$$V=P\cdot n$$
"""

ST = prices@n
ST

"""**Step 5**
- Present it **graphically**
"""

fig = go.Figure()

fig.add_trace(go.Scatter(x=ST.index,y= ST))

fig.show()

